import React from "react";
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";
import { Ionicons } from "@expo/vector-icons";

import FriendDirectory from "./FriendDirectory";
import GroupDirectory from "./GroupDirectory";
import QA from "./QA";

const Tab = createMaterialTopTabNavigator();

const DirectoryComponents = () => {
  return (
    <Tab.Navigator initialRouteName="Friends" tabBarPosition="top">
      <Tab.Screen name="Friends" component={FriendDirectory} />
      <Tab.Screen name="Groups" component={GroupDirectory} />
      <Tab.Screen name="QAs" component={QA} />
    </Tab.Navigator>
  );
};

export default DirectoryComponents;
